import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./LoginForm.css";

const LoginForm = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (e) => {
    e.preventDefault();
    // Handle login logic here (e.g., validate and submit form data)
    console.log("Email:", email);
    console.log("Password:", password);
  };

  return (
    <div className="login-form-container">
      <h2>Login to Mytalorzone</h2>
      <form onSubmit={handleLogin} className="login-form-form">
        <div className="login-form-input-group">
          <label htmlFor="email">Email</label>
          <input
            type="email"
            id="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter your email"
            required
          />
        </div>
        <div className="login-form-input-group">
          <label htmlFor="password">Password</label>
          <input
            type="password"
            id="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="Enter your password"
            required
          />
        </div>
        <button type="submit" className="login-form-btn">Login</button>
      </form>
      <div className="login-form-links">
        <Link to="/forgot-password" className="login-form-forgot-password">Forgot Password?</Link>
        <Link to="/signup" className="login-form-create-account">Create a New Account</Link>
      </div>
    </div>
  );
};

export default LoginForm;
